import './App.scss';
import Create from './Components/Create';
import List from './Components/List';

function App() {
  return (
    <div className="container">
      <div className="row">
        <div className="col-5">
          <Create />
        </div>
        <div className="col-7">
          <List />
        </div>
      </div>
    </div>
  );
}

export default App;
